# Use stim.PauliString to convert stabilizers
pauli_strings = []
for s in stabilizers:
    # Convert to stim format: + prefix and replace I with _
    stim_str = "+" + s.replace("I", "_")
    pauli_strings.append(stim.PauliString(stim_str))

print(f"Created {len(pauli_strings)} PauliStrings")

# Try to build a circuit using stim.Tableau.from_stabilizers
# Filter out stabilizer 12 which anticommutes with many others
good_ps = [ps for i, ps in enumerate(pauli_strings) if i != 12]
print(f"Using {len(good_ps)} stabilizers (removed index 12)")

try:
    tableau = stim.Tableau.from_stabilizers(good_ps, allow_redundant=True, allow_underconstrained=True)
    circuit = tableau.to_circuit()
    print("Circuit generated successfully!")
    print(f"Circuit has {len(circuit)} instructions")
    # Save circuit
    with open("data/claude-opus-4.6/agent_files/circuit_v1.stim", "w") as f:
        f.write(str(circuit))
    print("Saved to circuit_v1.stim")
except Exception as e:
    print(f"Error: {e}")
